css:
@-moz-document domain("js.tensorflow.org") {
body, body .main {
  background-color: #111
}

body header.mdc-toolbar, body footer {
  background-color: #003300 !important
}

p, h2, h3, div {
  color: #eee
}

body h1, body .page-banner h1 {
  color: #eee !important
}

body a, body a:visited {
  color: #00cc22
}

li {
  color: white
}

body .page-banner {
  background: linear-gradient(#003300, #009900)
}

.api-docs .toc a {
  color: #eee
}

.getting-started .gs-code code {
  background: #232323;
  color: #e6e1dc;
  padding-right: 10px
}

.api-docs .reference code.hljs {
  background: #000 !important; 
  color: #eee;
}

.api-docs .reference .symbol {
  background-color: #232323
}

.js, pre.hljs {
  background-color: #232323 !important;
  color: #eee
}

.api-docs .reference .snippet-console-log {
  background-color: #434343
}

.api-docs .reference .parameter-list li.parameter .param-type,
.api-docs .reference .returns .returns-header,
.api-docs .reference .parameter-list .heading {
  color: #9c7
}

.api-docs .reference .symbol .symbol-marker {
  background-color: #434343 !important;
  color: #eee
}

.mdc-drawer__drawer {
  background-color: #232323 !important
}




}
